INSERT INTO `news` VALUES (8,0,1,'今後のアプデ（予定）Vol1','miita運営チームです。\n今夜もシレッとおつかれさまです。\n\n今後のアップデート情報（予定）をお知らせします。\n\n【アプデ（予定）】\n・アカウント一覧画面\n名前の順でのソート機能\n\n・ゲーム一覧画面\nプラットフォームでのフィルタ機能\n\n・ガイドラインの画像登録\nガイドラインをアイコンで登録できるようにする。デザインとの兼ね合いを検討中です。\n\n・メンターどうしの会議室（掲示板）\nこれからの正義の話でもしましょう。\n\n今しばらくお待ちいただけたら幸いです。また、ご意見、ご要望がありましたら、DMやメールにてご連絡ください。\n\nそれでは、素晴らしきグッドゲームを?',1,'2021-02-13 14:44:09','2021-02-16 11:51:07',1),(9,0,1,'現状の仕様について','miita運営チームです。\n今夜もシレッとおつかれさまです。\n\n現在の仕様についてご説明します。現在、プラットファームごとにアカウントを登録する仕様にしています。\n\n理由は、ゲームによって仕様は異なるかと思いますが、異なるプラットフォーム間でプレイしていると、どのプラットファーム（プレステ、steam、switch）かわからないという事態が起こります。またsteamのアカウントはエイリアスのため、一意に定まらない。そのため、検索時に余計な処理（steamからIdをもとにエイリアス名をひっぱる）が必要になります。そのため、同一プラットフォームのみ検索、登録できるような仕様にしています。\n\nプラットファームを一緒にした方が、ゲーム全体の迷惑アカウント把握が容易で、汎用性もありますが、グッドゲームがしたいだけなのでいいかなと考えます。\n\nなにか気になる点などありましたら、DMでも、メールでもお問い合わせください。\n\nそれでは、素晴らしきグッドゲームを?',1,'2021-02-14 16:55:31','2021-02-16 22:30:32',1),(10,0,1,'【お詫び】SSL証明書の有効期限切れによるエラーについて','4/18(日)の未明、SSL証明書の有効期限切れによるエラーが発生しておりました。\n\n【障害内容】\nSSL証明書の有効期限切れによるエラー\n\n【対応済み】\nSSL証明書の更新\nキャッシュのクリア\n\n※改善されない場合\nもしブラウザを更新しても改善されない場合は、お手数ですが以下をお試しください。\n\n・新しいタブで開いてみてください。\n・お使いのブラウザから「miita.me」のサイトデータを削除し、再度アクセスしてください。\n\nこの度はご迷惑をおかけし、申し訳ありません。\nそれでは、グッドゲームをお楽しみください。',1,'2021-04-18 22:53:02','2021-04-18 23:14:30',1),(11,0,1,'【お詫び】サーバの通信障害について','契約中のサーバにて通信障害が発生し、以下の時間帯にて接続不良の状態が続いておりました。\n\n2023年08月09日(水) 16時頃〜21時頃\n\nこの度はご迷惑をおかけし申し訳ございません。\n引き続きグッドゲームをお楽しみください。',1,'2023-08-09 12:20:32','2023-08-09 12:26:11',1);
